import family from "../../../assets/cover/Family.jpg";
import FirstConvo from './FirstConvo';
import LongConvo from './LongConvo';
import SealTheDeal from './SealTheDeal';
import FirstDate from './FirstDate';

function About() {
  return (
    <section id="about-me" class="bio">
      <h2>Welcome to our Wishing Well!</h2>
      <img
        className="family"
        src={family}
        alt="Joseph Cooper with his wife Erin and their two dogs, Rosie and Rango."
      />
<p>We are thankful that you have come out today to support us. We don't expect anything from you just your physical presence. If you still however desire you're welcome to click any of the links above to donate to our wishign well which will be used to help fund our honeymoon in Hawa</p>
      <div class="info">

<FirstConvo />
<LongConvo />
<SealTheDeal />
<FirstDate />

        <div class="my-info">
          <h3>Future</h3>
          <p className="paragraph">
            I want to be challenged, due to my attention to detail and creative
            thinking I want to create new projects and improve on existing ones.
            I enjoy debugging and finding ways to improve usage and efficiency
            of existing applications. I want to work in a strong team
            environment that supports, challenges and adds value to each other's
            work and lives every day. I want to be a part of something big and
            be able to make a difference with the work I provide. I want to be
            your next asset.{" "}
          </p>
        </div>
      </div>
    </section>
  );
}

export default About;
